# def properAge(N):
#     age = {}
#     for i in range(1,120):
#         age[i] = []
#         for j in range(1,i+1):
#             if j>0.5 * i + 7:
#                 if i>100 and j < 100:
#                     continue
#                 else:
#                     age[i].append(j)
#     return age
#
# print(properAge(0))
#
#
#


def numFriendRequests(ages: 'List[int]'):
    agePool = {}
    for i in range(1, 120 + 1):
        agePool[i] = []
        for j in range(1, i + 1):
            if j > 0.5 * i + 7:
                if not (j > 100 and i < 100):
                    agePool[i].append(j)
                else:
                    pass

    ageCnt = {}
    for i in ages:
        if i not in ageCnt:
            ageCnt[i] = 0
        ageCnt[i] += 1

    output = 0

    for i in ages:
        curr = 0
        for j in agePool[i]:
            curr += ageCnt.get(j,0)

        output += curr - (1 if curr > 0 else 0)

    return output


